description:
𝐁𝐚́𝐧 đ𝐚̂́𝐭 𝐭𝐚̣̆𝐧𝐠 𝐧𝐡𝐚̀ 𝐱𝐮̛𝐨̛̉𝐧𝐠 𝐠𝐢𝐚́𝐩 𝐂𝐡𝐮́𝐜 𝐒𝐨̛𝐧!
🐔🐔 Diện tích : 164,7m full thổ cư
🐔🐔 Lô góc 2 mặt tiền, mặt tiền 8,1m - Nở hậu;
🐔🐔 Đường thông, xe tải vào thoải mái;
🐔🐔 Cách QL6 chỉ 200m, sát đường máng 7 liên xã rộng 18m
🐔🐔 Tiện ích xung quanh : Chợ Cống, trường học...đủ cả
𝐆𝐢𝐚́ đ𝐚̂̀𝐮 𝐭𝐮̛ đ𝐚𝐧𝐠 𝐜𝐮̛̣𝐜 𝐡𝐚̂́𝐩 𝐝𝐚̂̃𝐧, 𝐜𝐡𝐢̉ 𝟐𝐱𝐭𝐫/𝐦𝟐;
𝐀𝐧𝐡/𝐂𝐡𝐢̣ 𝐡𝐚̃𝐲 𝐧𝐡𝐚𝐧𝐡 𝐭𝐚𝐲 𝐛𝐚̂́𝐦 𝐠𝐨̣𝐢 𝐞𝐦 𝐒𝐢𝐞̂𝐮 𝐧𝐠𝐚𝐲 𝐧𝐡𝐞́!
